create table client ( 
    id varchar(20) not null,
    password varchar(20) not null,
    name varchar(20) not null,
    sex varchar(1),
    phone varchar(20),
    email varchar(20),
    address_num varchar(20),
    address_city varchar(80),
    mileage int,
    cash    int,
    passportnum varchar(20),
    limit_passport DATE,
    primary key(id) 
)ENGINE = INNODB;


